[gcode_macro PA_PATTERN]
description: Print a box to calibrate the extrusion pressure advance
gcode:
    #
    # PARAMETERS
    #
    {% set e_multiplier = params.EXTRUSION_MULTIPLIER|default(1.00)|float %} # extrusion multiplier for the shell
    {% set filament_diameter = params.FILAMENT_DIAMETER|default(1.75)|float %} # filament diameter

    {% set feedrate_print = params.PRINT_SPEED|default(100)|int * 60 %} # print feedrate
    {% set feedrate_travel = params.TRAVEL_SPEED|default(200)|int * 60 %} # travel feedrate between print moves
	{% set feedrate_accel  = params.ACCEL_SPEED|default(5000)|int * 60 %} # acceleration feedrate
    {% set feedrate_anchorbox = params.ANCHORBOX_SPEED|default(60)|int * 60 %} # print feedrate for printing raft
    {% set feedrate_z = params.Z_LIFT_SPEED|default(20)|int * 60 %} # z axis travel feedrate
	
    # Extruder and bed temperatures
    {% set BED_TEMP = params.BED_TEMP|default(60)|float %}
    {% set EXTRUDER_TEMP = params.EXTRUDER_TEMP|default(190)|float %}
	
    # Heatsoak time of the bed in minutes and chamber temperature wanted
    {% set SOAK = params.SOAK|default(8)|int %}

    # Default material type to 'XXX'
    {% set MATERIAL = params.MATERIAL|default("XXX")|string %}
    {% if MATERIAL == "PLA" %}
        #Load saved mesh at print start instead of probe.
    	BED_MESH_PROFILE LOAD=60C
        SET_GCODE_OFFSET Z_ADJUST=0.10 MOVE=1
        SET_RETRACTION RETRACT_LENGTH=0.4 RETRACT_SPEED=60 UNRETRACT_EXTRA_LENGTH=0 UNRETRACT_SPEED=60
    {% elif MATERIAL == "PET" %}
        #Load saved mesh at print start instead of probe.
    	BED_MESH_PROFILE LOAD=85C
        SET_GCODE_OFFSET Z_ADJUST=0 MOVE=1
        SET_RETRACTION RETRACT_LENGTH=1.4 RETRACT_SPEED=30 UNRETRACT_EXTRA_LENGTH=0 UNRETRACT_SPEED=20
    {% elif MATERIAL == "ABS" %}
        #Load saved mesh at print start instead of probe.
    	BED_MESH_PROFILE LOAD=110C
        SET_GCODE_OFFSET Z_ADJUST=0.15 MOVE=1
        SET_RETRACTION RETRACT_LENGTH=0.3 RETRACT_SPEED=40 UNRETRACT_EXTRA_LENGTH=0 UNRETRACT_SPEED=30
    {% elif MATERIAL == "ASA" %}
        SET_RETRACTION RETRACT_LENGTH=0 RETRACT_SPEED=40 UNRETRACT_EXTRA_LENGTH=0 UNRETRACT_SPEED=30
    {% endif %}
	
	# part cooling fan speed in percent (0-100)
	{% set fan_speed = params.FAN_SPEED|default(20)|int %} 

	M190 S{BED_TEMP} ; Set & wait for bed temp
    M109 S{EXTRUDER_TEMP} ; Set & wait for hotend temp
    MATERIAL={MATERIAL}
    PRIME_BLOB
	G21 # Millimeter units
	G90 # Absolute XYZ
	M83 # Relative E
	G92 E0 # Reset extruder distance
#
#  Begin printing
#
	M106 S0 # Set fan speed
	SET_VELOCITY_LIMIT ACCEL={feedrate_accel} # Set printing acceleration
	G10 # Retract
	G0 Z5 F{feedrate_z} # Z raise
	G0 X112.6417 Y121.5068 F{feedrate_travel} # Move to start position
	G0 Z0.25 F{feedrate_z} # Move to start layer height
	G11 # Un-retract
	SET_PRESSURE_ADVANCE ADVANCE=0 # Set pressure advance to start value
